import "./App.css";
import {Link, Route, Routes, useParams} from "react-router-dom";

const Page1 = () => {
    return (
        <div className="page">
            <h3>Page 1: About Us</h3>
            <p>We are a song shop</p>
            <div>
                <img src="https://songshop.ca/wp-content/uploads/2020/02/cropped-songShopLogo.png" alt=""/>
            </div>
        </div>
    )
}

const Page2 = () => {
    return (
        <div>
            <h3>Page 2:</h3>
            <p>List of songs</p>
        </div>
    )
}

const Page3 = (props) => {
    let page3Params = useParams()
    console.log(page3Params)
    const {name} = page3Params

    console.log('props of page3', props)
    return (
        <div>
            <h3>Page 3: {`${name}`}</h3>
            <h3>{`Singer id is ${props.singerId}`}</h3>
        </div>
    )
}

const NavBar = () => {

    let name = 'Just Say When'

    return (
        <nav style={{ width: 500, display: 'flex', justifyContent: 'space-between' }}>
            <Link to="/page1">
                Page 1
            </Link>
            <Link to="/page2">
                Page 2
            </Link>
            <Link to={`/product/${name}`}>Page 3</Link>
        </nav>
    )
}

function App() {
    return (
        <div className="App">
            <h1>
                My app
            </h1>
            <NavBar/>

            <Routes>
                <Route path="/page1" element={<Page1/>}/>
                <Route path="/page2" element={<Page2/>}/>
                <Route path="/product/:name" element={<Page3 singerId={'789'} prop2={'bbb'}/>}/>
            </Routes>
            <footer>This is the footer</footer>
        </div>
    );
}

export default App;
